$.noConflict(),jQuery(function(t){t(".url-form").on("submit",r=>{r.preventDefault();let l=t(".url-form"),a=t("#ajax-response");t.ajax({type:"POST",url:"/create_url",data:l.serialize(),success:t=>{"url"in t?(a.html('<div style="display:flex;"><input id="shorturl" class="form-control" value="'+t.url+'" readonly><button type="button" class="btn btn-dark clipboardBtn" data-clipboard-target="#shorturl">Copy</button></div>').fadeIn(250),new ClipboardJS(".clipboardBtn")):a.html('<h3 class="h3 font-weight-normal">'+t.error_msg+"</h3>").fadeIn(250)}})})});